import PropTypes from 'prop-types'

const Taskbarbutton = ({ color, text, onClick }) => {

    return (
        <div>
            <button
            onClick={onClick} 
            style={{ backgroundColor: color }} 
            className='tbtn'>
                {text}
            </button>
        </div>
    )
}

Button.defaultProps = {
    color : 'steelblue'
}

Button.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string,
    onClick: PropTypes.func,
}

export default TaskbarButton
